import React from 'react';
import { Route, Switch } from 'react-router-dom';

import './App.css';

import HomePage from './pages/homepage/homepage';

const HatsPage = () => (
	<div>
		<h1>HATS PAGE</h1>
	</div>
);

function App() {
	return (
		<div>
			<Switch>
				<Route exact exact path='/' component={HomePage} />
				<Route exact path='shop/hats' component={HatsPage} />
			</Switch>
		</div>
	);
}

export default App;
